import React from "react";
import styles from "./summary.module.css";
import Header from "../HomePage/components/header/header";

function Summary() {
  return (
    <div>
     <Header />
    <div className={styles.summary_wrapper}>
      <h1> Find the best Summaries here</h1>
      <div className={styles.top_bar}></div>
      <div className={styles.summary_area}>
        <div className={styles.summary_input}>
        <textarea
            placeholder="Enter your text here ... "
            className={styles.input_textarea}>
          </textarea>
          <button className={styles.generate_btn}> Generate </button>
        </div>
        <div className={styles.summary_output}> </div>
      </div>
      </div>
    </div>
  );
}

export default Summary;
